"use strict";
const electron = require("electron");
const path = require("path");
const utils = require("@electron-toolkit/utils");
const client = require("@prisma/client");
const icon = "data:image/png;base64,";
const prisma = new client.PrismaClient();
async function createCustomer(data) {
  try {
    const {
      customer_name,
      customer_email,
      customer_phone,
      customer_address,
      customer_cpf
    } = data;
    const userExists = await prisma.customer.findFirst({
      where: {
        OR: [
          { customer_name },
          { customer_cpf },
          { customer_phone }
        ]
      }
    });
    if (userExists) {
      if (userExists.customer_name === customer_name) {
        throw new Error("Nome já cadastrado");
      }
      if (userExists.customer_cpf === customer_cpf) {
        throw new Error("CPF já cadastrado");
      }
      if (userExists.customer_phone === customer_phone) {
        throw new Error("Telefone já cadastrado");
      }
    }
    await prisma.customer.create({
      data: {
        customer_name,
        customer_email: customer_email || null,
        customer_phone,
        customer_address,
        customer_cpf
      }
    });
  } catch (error) {
    console.error(error);
    throw error;
  }
}
async function getCustomers() {
  try {
    return await prisma.customer.findMany();
  } catch (error) {
    throw new Error("Erro ao buscar clientes");
  }
}
async function getSearchCustomer(customerName) {
  try {
    const customers = await prisma.customer.findMany({
      where: customerName ? {
        customer_name: {
          contains: customerName.toLowerCase()
        }
      } : void 0,
      orderBy: {
        customer_name: "asc"
      }
    });
    return customers.length ? customers : [];
  } catch (error) {
    throw new Error("Erro ao buscar clientes");
  }
}
async function updateCustomer(id, data) {
  try {
    const customerExists = await prisma.customer.findUnique({
      where: { id }
    });
    if (!customerExists) {
      throw new Error("Cliente nao encontrado");
    }
    const customerUpdated = await prisma.customer.update({
      where: { id },
      data: {
        customer_name: data.customer_name,
        customer_email: data.customer_email,
        customer_phone: data.customer_phone,
        customer_address: data.customer_address,
        customer_cpf: data.customer_cpf
      }
    });
    return customerUpdated;
  } catch (error) {
    throw new Error("Erro ao atualizar o cliente");
  }
}
async function deleteCustomer(id) {
  try {
    const customerExists = await prisma.customer.findUnique({
      where: { id }
    });
    if (!customerExists) {
      throw new Error("Cliente nao encontrado");
    }
    await prisma.customer.delete({
      where: { id }
    });
  } catch (error) {
    throw new Error("Erro ao deletar o cliente");
  }
}
